<template>
	<view class="login">
		<tui-loading :visible="isloading" :text="texts"></tui-loading>
		<view class="mask" v-if="isloading"></view>
		<view class="masks" v-if="isUpdata"></view>
		<view class="content">
			<view class="header">
				<text>欢迎登录智慧金柚</text>
			</view>
			<view class="content_div"></view>
			<!-- 主体表单 -->
			<view class="main">
				<wInput v-model="phoneData" type="text" maxlength="30" placeholder="请输入手机号码" class="winput"></wInput>
				<wInput v-model="passData" type="password" maxlength="30" placeholder="请输入密码" class="winput" style="margin-top: 30rpx;"
				 @focus="loginfoc()"></wInput>
			</view>
			<wButton text="登 录" :rotate="isRotate" @click.native="startLogin()"></wButton>
			<!-- <view class="mask" v-if="isUpdata"></view> -->
			<view class="updataDiv" v-if="isUpdata">
				<view style="margin: 0rpx 54rpx;">
					<image src="../../static/images/updateApp.png" class="updataimg"></image>
					<view style="position: relative;">
						<text style="margin-left: 102rpx;">最新版本</text>
						<view class="updatecode">
							{{vercode}}
						</view>
					</view>
					<view style="height: 170rpx;overflow:auto;margin-top: 20rpx;">
						<view class="updatecont" v-for="(item,index) in updacontent"  :key="index">
							<text>{{item}}</text>
						</view>
					</view>
					<view class="notipView">
						<label class="tui-checkbox">
							<checkbox color="#fff" v-model="checkVal"  v-on:click="checkItem(checkVal)"><text style="margin-left: 30rpx;">忽略该版本并不再提醒</text></checkbox>
						</label>
					</view>
					<view class="updataView" v-if="updataing">
						<view class="updataview-text" style="color: #6A6A75;" @click.native="noUpdata()">取消</view>
						<view class="updataview-text" style="color: #7DA4F3;" @click.native="goUpdata()">立即更新</view>
					</view>
					<cmd-progress :percent="jindu" status="active" stroke-width="10" v-if="!updataing" :isbgwhite="true"></cmd-progress>
					<view v-if="!updataing" style="width: 100%;text-align: center;">
						<text>{{downloadedSize}}M / {{totalSize}}M</text>
					</view>
				</view>
			</view>

			<!-- 底部信息 -->
			<!-- <view class="footer">
				<navigator url="forget" open-type="navigate">找回密码</navigator>
				<text>|</text>
				<navigator url="register" open-type="navigate">注册账号</navigator>
			</view> -->

			<!-- <view class="login_text">
				<view style="margin:0upx 20upx 0upx 82upx"></view>
				<text>其他方式登录</text>
				<view style="margin:0upx 0upx 0upx 20upx"></view>
			</view> -->

			<!-- 其他登录 -->
			<!-- <view class="other_login cuIcon">
				<view class="login_icon">
					<view class="cuIcon-weixin" @tap="login_weixin"></view>
				</view>
				<view class="login_icon">
					<view class="cuIcon-weibo" @tap="login_weibo"></view>
				</view>
				<view class="login_icon">
					<view class="cuIcon-github" @tap="login_github"></view>
				</view>
			</view> -->

			<!-- 用户协议 -->
			<!-- <view class="terms">
				<text>注册/登录表示同意</text>
				<navigator url="" open-type="navigate" class="appcolor">《用户协议》</navigator>
				<text class="appcolor">|</text>
				<navigator url="" open-type="navigate" class="appcolor">《隐私条款》</navigator>
			</view> -->
		</view>
	</view>
</template>

<script>
	var _this;
	import wInput from '@/components/watch-login/watch-input.vue' //input
	import wButton from '@/components/watch-login/watch-button.vue' //button
	import cmdProgress from "@/components/cmd-progress/cmd-progress.vue"
	import tuiLoading from '@/components/loading/loading.vue';
	export default {
		data() {
			return {
				phoneData: '', //用户/电话
				passData: '', //密码
				isRotate: false, //是否加载旋转
				isUpdata: false, //是否提示更新
				appUrl: '',
				jindu: '0',
				vercode:null,
				updacontent:[],
				updataing:true,
				isloading: false,
				texts:'确认版本信息',
				totalSize:0,
				downloadedSize:0,
				notips:false,
				checkVal:false,
				noupdowns:false,
				markver:'',
			};
		},
		components: {
			wInput,
			wButton,
			cmdProgress,
			tuiLoading
		},
		mounted() {
			_this = this;
			this.isLogin();
		},
		methods: {
			checkItem(item){
				let that = this;
				setTimeout(()=>{
					that.checkVal = !item
				},0)
			},
			isLogin() {
				let that = this;
				//判断是否需要自动更新
				plus.runtime.getProperty(plus.runtime.appid, function(inf) {
					that.wgtVer = inf.version; //获取当前版本号
					// 获取本地应用资源版本号 
					that.svn(that.wgtVer)
				});
			},
			autologin(){
				//判断缓存中是否登录过，直接登录
				try {
					const value = uni.getStorageSync('setUsertoken');
					if (value) {
						uni.reLaunch({
							url: '../index/index',
						});
					}
				} catch (e) {
					// error
				}
			},
			svn(t) {
				let _that = this;
				_that.isloading = true;
				var xhr_svn = new plus.net.XMLHttpRequest();
				xhr_svn.onreadystatechange = function() {
					if (xhr_svn.readyState == 4) {
						if (xhr_svn.status == 200) {
							_that.isloading = false;
							var res = JSON.parse(xhr_svn.responseText);
							_that.markver = res.mark;
							if (res.state == 'yes') {
								if (res.mark != t) {
									//判断是否忽略版本更新
									let value = {};
									try {
										value = uni.getStorageSync('noupdowns');
										if (value) {
											_that.noupdowns = value.checkVal;
										}
									} catch (e) {
										// error
									}
									if(_that.noupdowns&&res.mark==value.markver){
										_that.autologin();
										return;
									}
									_that.isUpdata = true
									_that.appUrl = res.url
									_that.vercode = 'V'+res.mark;
									_that.updacontent=res.updateContent.split(",");
								}else{
									_that.autologin();
								}
							}
						} else {
							uni.showToast({
								icon: 'none',
								position: 'bottom',
								title: '网络连接错误'
							});
						}
					}
				}
				xhr_svn.open("GET", this.$http.common.updataUrl+"/update.json"); //这里的地址是上面json文件的地址   
				xhr_svn.send();
			},
			async startLogin() {
				//登录
				if (this.isRotate) {
					//判断是否加载中，避免重复点击请求
					return false;
				}
				if (this.phoneData.length == "") {
					uni.showToast({
						icon: 'none',
						position: 'bottom',
						title: '账号不能为空'
					});
					return;
				}
				if (this.passData.length == "") {
					uni.showToast({
						icon: 'none',
						position: 'bottom',
						title: '密码不能为空'
					});
					return;
				}
				var data = {
					username: this.phoneData,
					password: this.passData
				}

				_this.isRotate = true
				this.$http.post(this.$appurl.logins, data).then((res) => {
					if (res.success) {
						var token = res.result.token;
						try {
							uni.setStorageSync('setUsertoken', token); //存入缓存
						} catch (e) {
							// error
						}
						setTimeout(function() {
							_this.isRotate = false;
							uni.reLaunch({
								url: '../index/index',
							});
						}, 1000);
					} else {
						uni.showToast({
							position: 'bottom',
							title: res.message
						})
						_this.isRotate = false;
					}
				})
			},
			login_weixin() {
				//微信登录
				uni.showToast({
					icon: 'none',
					position: 'bottom',
					title: '...'
				});
			},
			login_weibo() {
				//微博登录
				uni.showToast({
					icon: 'none',
					position: 'bottom',
					title: '...'
				});
			},
			login_github() {
				//github登录
				uni.showToast({
					icon: 'none',
					position: 'bottom',
					title: '...'
				});
			},
			noUpdata() {
				this.isUpdata = false;
				if(this.checkVal){
					var data = {
						markver: this.markver,
						checkVal: this.checkVal
					}
					try {
						uni.setStorageSync('noupdowns', data); //存入缓存
					} catch (e) {
						// error
					}
				}
				this.autologin();
			},
			goUpdata() {
				this.updataing = false;
				let that = this;
				var url = this.appUrl;
				console.log(url)
				var dtask = plus.downloader.createDownload(url, {}, function(d, status) {
					if (status == 200) { // 下载成功   
						var path = d.filename;
						plus.runtime.install(path);
					} else { //下载失败   
					}
				});
				var sizes = 0;
				dtask.addEventListener("statechanged", function(task, status) {
					if (task.state == 0) {} else if (task.state == 2) {

					} else if (task.state == 3) {
						var sizeApp = task.downloadedSize / task.totalSize * 100;
						that.jindu = parseInt(sizeApp)
						that.downloadedSize = (task.downloadedSize / 1024 / 1024).toFixed(2);
						that.totalSize = (task.totalSize / 1024 / 1024).toFixed(2);
					} else if (task.state == 4) {

					}
				})
				dtask.start();
			}
		}
	}
</script>

